import React from 'react';
import { Button, Container, Header } from 'semantic-ui-react';

function Navbar() {
  return (
    <Container>
      <Header as="h2">Welcome to Semantic UI in React</Header>
      <Button primary>Primary Button</Button>
    </Container>
  );
}

export default Navbar;
